import React, { Component } from "react";
import { Navigate } from "react-router-dom";
import "./NavBar.css";

class NavBar extends Component {
    render() {
        const { firstName, lastName, logoutKey } = this.props;

        const handleLogout = () => {
            try {
                localStorage.removeItem('currentUser');
                logoutKey();
                // Navigate to "/" after logout
                return <Navigate to="/" />;
            } catch(error) {
                console.error('Error during logout:', error);
            }
        };

        return (
            <nav className="navbar">
                <ul className="navbar-list">
                    {/* Display first and last name if available */}
                    {firstName && lastName && (
                        <li className="navbar-item">
                            {firstName} {lastName}
                        </li>
                    )}
                    <li className="navbar-item">
                        <Link to="/">Homepage</Link>
                    </li>
                    {(!firstName || !lastName) && (
                        <>
                            <li className="navbar-item">
                                <Link to="/login">Login</Link>
                            </li>
                            <li className="navbar-item">
                                <Link to="/signup">Signup</Link>
                            </li>
                        </>
                    )}
                    {firstName && lastName && (
                        <>
                            <li className="navbar-item">
                                <Link to="/companies">Companies</Link>
                            </li>
                            <li className="navbar-item">
                                <Link to="/jobs">Jobs</Link>
                            </li>
                            <li className="navbar-item">
                                <Link to="/users">Users</Link>
                            </li>
                            <li className="navbar-item">
                                <Link to="/profileeditpage">Profile Edit Page</Link>
                            </li>
                            {/* Replace Link with Navigate */}
                            <li className="navbar-item">
                                <Navigate to="/" onClick={handleLogout}>Logout</Navigate>
                            </li>
                        </>
                    )}
                </ul>
            </nav>
        );
    }
}

export default NavBar;
